<script type="text/javascript">
	var zan_link = '';
	$('#form-search-problem').submit(function(e) {
		e.preventDefault();
		
		url = 'http://oj.daimayuan.top/problems';
		qs = [];
		$(['search']).each(function () {
			if ($('#input-' + this).val()) {
				qs.push(this + '=' + encodeURIComponent($('#input-' + this).val()));
			}
		});
		if (qs.length > 0) {
			url += '?' + qs.join('&');
		}
		location.href = url;
	});
</script>

	if (localStorage.getItem("lastcontest_id=" + this_id + "?" + uoj_user) == null) 
		registernum = Number(registernum) + 1;
	localStorage.setItem("lastcontest_id=" + this_id + "?register", registernum);
	localStorage.setItem("lastcontest_id=" + this_id + "?" + uoj_user, 1);
	location.href = "";
}
function go_unbm(uoj_user) {
	var registernum = localStorage.getItem("lastcontest_id=" + this_id + "?register");
	if (localStorage.getItem("lastcontest_id=" + this_id + "?" + uoj_user) != null) 
		registernum = Number(registernum) - 1;
	localStorage.setItem("lastcontest_id=" + this_id + "?register", registernum);
	localStorage.removeItem("lastcontest_id=" + this_id + "?" + uoj_user);
	location.href = "";
}
if (localStorage.getItem("uoj-user_" + uoj_username + "_gler") > 0) {
	document.write('<h5>选手报名</h5><textarea class="form-control" id="input-custom_test_register_editor" name="custom_test_contest_editor" style="overflow: hidden; overflow-wrap: break-word; resize: none;"></textarea>');
	document.write('<h5 style="margin-top: 5px;">选手取消报名</h5><textarea class="form-control" id="input-custom_test_unregister_editor" name="custom_test_contest_editor" style="overflow: hidden; overflow-wrap: break-word; resize: none;"></textarea>');
	document.write('<div class="text-center"><button type="submit" class="mt-2 btn btn-secondary" onclick="go();">提交</button></div>');
}
function go() {
	var bm = document.getElementById("input-custom_test_register_editor").value;
	if (bm != "") {
		bm = bm + "\n";
		var last = 0;
		for (var i = 0; i < bm.length; i++) {
			if (bm[i] == '\n') {
				go_bm(bm.substring(last, i));
				last = i + 1;
			}
		}
	}
	bm = document.getElementById("input-custom_test_unregister_editor").value;
	if (bm != "") {
		bm = bm + "\n";
		last = 0;
		for (var i = 0; i < bm.length; i++) {
			if (bm[i] == '\n') {
				go_unbm(bm.substring(last, i));
				last = i + 1;
			}
		}
	}
}
